import React from 'react';

type Button = {
    name:string;
    started:()=>void
    value?:number;
}


const  ButtonStyle = {
    color:'blue',
    height:'30px',
    width:'50px',
    borderRadius:'8px',

}

const boxButton = {
    width:'200px',
    height:'100px',
    borderRadius:'5px',
    display:'inline-block',
    border: '1px solid #61dafb',

    marginTop:'10px'
}
export  const Button = (props:Button) => {
    return (
        <span style={boxButton}>
            <button style={ButtonStyle}  disabled={props.value===5} onClick={props.started}>{props.name}</button>
        </span>
    );
};
